

create table customer
(
    id                 int          not null
        primary key,
    fname              varchar(255) null,
    lname              varchar(255) null,
    address            varchar(255) null,
    city               varchar(255) null,
    state              varchar(255) null,
    zip                varchar(255) null,
    phone              varchar(255) null,
    company_name       varchar(255) null,
    type               varchar(1)   null,
    discount           int          null,
    max_quantity_order int          null
);

create table department
(
    dept_id      int          not null
        primary key,
    dept_name    varchar(255) null,
    dept_head_id int          null
);

create index dept_head_id
    on department (dept_head_id);

create table employee
(
    emp_id           int           not null
        primary key,
    manager_id       int           null,
    emp_fname        varchar(255)  null,
    emp_lname        varchar(255)  null,
    dept_id          int           null,
    street           varchar(255)  null,
    city             varchar(255)  null,
    state            varchar(255)  null,
    zip_code         varchar(255)  null,
    phone            varchar(255)  null,
    status           varchar(255)  null,
    ss_number        varchar(255)  null,
    salary           double(15, 5) null,
    start_date       datetime      null,
    termination_date varchar(255)  null,
    birth_date       datetime      null,
    bene_health_ins  varchar(255)  null,
    bene_life_ins    varchar(255)  null,
    bene_day_care    varchar(255)  null,
    sex              varchar(255)  null,
    constraint empl_dept_fk
        foreign key (dept_id) references department (dept_id)
);

create index DepartmentEmployee
    on employee (dept_id);

create index dept_id
    on employee (dept_id);

create index manager_id
    on employee (manager_id);

create index zip_code
    on employee (zip_code);

create table fin_code
(
    code        varchar(255) not null
        primary key,
    type        varchar(255) null,
    description varchar(255) null
);

create table product
(
    id           int           not null
        primary key,
    name         varchar(255)  null,
    description  varchar(255)  null,
    prod_size    varchar(255)  null,
    color        varchar(255)  null,
    quantity     int           null,
    unit_price   double(15, 5) null,
    picture_name varchar(255)  null,
    category     varchar(1)    null
);

create table sales_order
(
    id          int          not null
        primary key,
    cust_id     int          null,
    order_date  datetime     null,
    fin_code_id varchar(255) null,
    region      varchar(255) null,
    sales_rep   int          null,
    constraint saor_cust_fk
        foreign key (cust_id) references customer (id),
    constraint saor_empl_fk
        foreign key (sales_rep) references employee (emp_id),
    constraint saor_fico_fk
        foreign key (fin_code_id) references fin_code (code)
);

create index CustomerSales_order
    on sales_order (cust_id);

create index EmployeeSales_order
    on sales_order (sales_rep);

create index Fin_codeSales_order
    on sales_order (fin_code_id);

create index cust_id
    on sales_order (cust_id);

create index fin_code_id
    on sales_order (fin_code_id);

create table sales_order_item
(
    id        int      not null,
    line_id   int      not null,
    prod_id   int      null,
    quantity  int      null,
    ship_date datetime null,
    primary key (id, line_id),
    constraint sait_prod_fk
        foreign key (prod_id) references product (id),
    constraint sait_saor_fk
        foreign key (id) references sales_order (id)
);

create index ProductSales_order_item
    on sales_order_item (prod_id);

create index Sales_orderSales_order_item
    on sales_order_item (id);

create index Sales_order_itemid
    on sales_order_item (id);

create index line_id
    on sales_order_item (line_id);

create index prod_id
    on sales_order_item (prod_id);
	
	
	


	
	
	

   
   
   
   
   
   
	
	
   

